import React, { useEffect, useState } from "react";

import ResolCSS from '../styles/Resolution.module.css'

export default function ResolutionCheck() {
    let [paramId, setParamId] = useState()


    async function getData() {
        let paramId = window.location.pathname.split('/')[1]
        setParamId(paramId)

        let data = fetch(`/resolution/${paramId}/check`).then(r => console.log(r.json()))
    }

    useEffect(() => {
        getData()
    }, [])

    return <>
        <div>ResolutionCheck</div>
    </>
}
